INSERT INTO `sys_oper_log` VALUES (774, '邮件保存-写信', 1, 'com.ruoyi.web.controller.email.EmailController.save()', 'POST', 1, 'admin', NULL, '/email/info/save', '127.0.0.1', '内网IP', '{\"attachmentIdList\":[109,110],\"content\":\"<p>你好，我是sohu邮箱。<br></p><p>------------------ Original ------------------</p><p><strong>From: </strong><a href=\\\"mailto:13076506601@163.com\\\" target=\\\"_blank\\\">13076506601@163.com</a></p><p><strong>Send time: </strong> Monday, November 11, 2019 3:17 PM</p><p><strong>To: </strong><a href=\\\"mailto:w0r1d_space@sohu.com\\\" target=\\\"_blank\\\">w0r1d_space@sohu.com</a></p><p><strong>Subject: </strong> 北约正经历脑死亡德外长警告法国不要破坏北约</p><p><br></p><p> （原标题：马克龙说北约正经历“脑死亡”，德外长警告法国不要破坏北约） </p><p><br></p><p>【环球网报道 记者 侯佳欣】据路透社报道，德国外长海科·马斯当地时间11月10日警告法国，不要破坏北大西洋公约组织(NATO)。路透社称，这是柏林方面迄今为止对马克龙批评北约相关言论作出的最强烈回应。马克龙日前接受英国《经济学人》杂志采访时称，北约正在经历“脑死亡”。</p><p><img src=\\\"http://cms-bucket.ws.126.net/2019/11/11/c1d93d4ec8cb4feda3af3235f0b7d472.jpeg\\\" alt=\\\"\\\" data-href=\\\"\\\" style=\\\"\\\"/></p><p style=\\\"text-align: center;\\\">(德国外长海科·马斯。图源：路透社)</p><p>针对马克龙的言论，马斯在德国《明镜》周刊发表专栏文章写道：“如果我们削弱了北约，这可能是个错误。没有美国，无论是德国或欧洲都没有办法有效地保护自己。”</p><p><img src=\\\"http://cms-bucket.ws.126.net/2019/11/11/83b5435880684aaeb606a11ffc386e14.png\\\" alt=\\\"\\\" data-href=\\\"\\\" style=\\\"\\\"/></p><p style=\\\"text-align: center;\\\">(路透社报道截图)</p><p>不过，对于马克龙加强欧洲防御能力的呼吁，马斯表示支持。他在文章中写道，“这就是为什么我们要与法国一起努力，建设一个在安全政策上更加紧密合作的欧洲的原因。”</p><p>报道称，马斯再次呼吁建立一个欧洲安全理事会，英国也应该成为其中一员，尽管英国已经计划退出欧盟。马斯称，他正在与法国外长让－伊夫·勒德里昂开展密切合作，德国将在2020年下半年担任欧盟轮值主席国期间提出这个理事会的框架。</p><p>关于马克龙关于北约正在经历“脑死亡”的发言，除德国外长马斯之外，北约秘书长廷斯·斯托尔滕贝格、德国总理默克尔等人也不认同马克龙的观点。</p><p>斯托尔滕贝格称北约依然牢固，“任何疏远欧洲与美国关系的做法不仅有削弱跨大西洋纽带的风险，且可能分裂欧洲”，“欧洲团结不能代替大西洋两岸间的团结”。默克尔同样显现对北约的支持，说这一持续70年的军事联盟“不可或缺”，虽然存在一些问题，但是“符合我们的利益”。</p><p>“北约正在经历‘脑死亡’。”英国《经济学人》杂志7日刊登对法国总统马克龙的专访，他警告欧洲国家，特朗普领导的美国显然“抛弃了我们”，站在“悬崖边上”的欧洲需要思考自己的战略问题，否则将“无法掌控自己的命运”。</p><p><br></p><p> </p><p><br></p><p> 本文来源：环球网 责任编辑：李再兴_NBJS9026<img src=\\\"http://47.244.55.212:8080/435b2d75-3304-4caa-a588-6044dc82e7c9.jpg\\\" alt=\\\"\\\" data-href=\\\"\\\" style=\\\"\\\"/></p>\",\"fromer\":\"w0r1d_space@sohu.com\",\"receiver\":\"[{\\\"email\\\":\\\"13076506601@163.com\\\",\\\"name\\\":\\\"13076506601@163.com\\\"}]\",\"taskId\":17,\"title\":\"Re: 北约正经历脑死亡德外长警告法国不要破坏北约\"}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":14357}', 0, NULL, '2023-09-15 14:26:49', 22721);
INSERT INTO `sys_oper_log` VALUES (775, '邮件保存-写信', 1, 'com.ruoyi.web.controller.email.EmailController.save()', 'POST', 1, 'admin', NULL, '/email/info/save', '127.0.0.1', '内网IP', '{\"attachmentIdList\":[],\"content\":\"<p>你好，我是sohu邮件。<br></p><p>------------------ Original ------------------</p><p><strong>From: </strong><a href=\\\"mailto:13076506601@163.com\\\" target=\\\"_blank\\\">13076506601@163.com</a></p><p><strong>Send time: </strong> Monday, November 11, 2019 3:23 PM</p><p><strong>To: </strong><a href=\\\"mailto:w0r1d_space@sohu.com\\\" target=\\\"_blank\\\">w0r1d_space@sohu.com</a></p><p><strong>Subject: </strong> 易学有道最新资讯信息　全面学习资料与你分享</p><p><br></p><p><span style=\\\"color: rgb(255, 0, 0); font-size: 16px;\\\"><strong>本文为网易教育频道专稿，转载请注明来源。</strong></span></p><p><img src=\\\"http://cms-bucket.nosdn.127.net/09beadf04a734333a44845110872e91d20180130170426.jpeg?imageView&thumbnail=550x0\\\" alt=\\\"易学有道最新资讯信息　全面学习资料与你分享\\\" data-href=\\\"\\\" style=\\\"\\\"/><br></p><p><span style=\\\"font-size: 14px;\\\">一个人奋斗没意思?易学有道陪你一起奋斗，国民大学士“大易”，知无不答!伴你学习，带你飞!!!</span></p><p>不用多久，你就会超过尖子生、走进好大学、考下四六级......走上人生巅峰! 想一想是不是感觉很激动呢?快点动一动你的手指关注一下，打开微信扫一扫，开启学习狂欢趴!抓紧时间行动吧!</p><p> </p><p><br></p><p>你有没有遇到过这样的情况呢？因记错了考试时间或者是考试地点，而错过了考试呢？有没有因为找了好多家网站或者是图书馆，找不到你要的学习资料呢？在“易学有道”里有丰富的教学内容：</p><p>易资讯最新的考试类资讯信息；</p><p>活动一下没事笑一笑乐一乐，给你一个轻松的学习环境；</p><p>有道大全丰富全面的学习资料，幼儿、中小学、高考……外语、出国留学、移民等，在有道大全里应用尽有。</p><p>易学有道丰富全面免费的学习资料：</p><p>大易在幼儿、中小学……外语、出国留学、移民等领域帮你解决问题。在学习时你遇到的问题，都会在易学有道里得到答案。关注我们的微信公众帐号就会得到你想要的。</p><p> 本文来源：网易教育频道综合 责任编辑：马志秋_NQ2478<img src=\\\"http://47.244.55.212:8080/3ddc93cd-46a1-4aba-88f5-8d459dd91c9d.jpg\\\" alt=\\\"\\\" data-href=\\\"\\\" style=\\\"\\\"/></p>\",\"fromer\":\"w0r1d_space@sohu.com\",\"pullEmailId\":14080,\"receiver\":\"[{\\\"email\\\":\\\"13076506601@163.com\\\",\\\"name\\\":\\\"13076506601@163.com\\\"}]\",\"taskId\":17,\"title\":\"Re: 易学有道最新资讯信息　全面学习资料与你分享\"}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":14358}', 0, NULL, '2023-09-15 14:32:39', 13733);
