INSERT INTO `sys_oper_log` VALUES (843, '邮件保存-写信', 1, 'com.ruoyi.web.controller.email.EmailController.save()', 'POST', 1, 'admin', NULL, '/email/info/save', '127.0.0.1', '内网IP', '{\"attachmentIdList\":[],\"content\":\"<p><br></p><p>------------------ Original ------------------</p><p>From:  <a href=\\\"mailto:13076506601@163.com\\\" target=\\\"_blank\\\">13076506601@163.com</a></p><p>Send time: Monday, November 11, 2019 3:17 PM</p><p><strong>To: </strong><a href=\\\"mailto:w0r1d_space@sohu.com\\\" target=\\\"_blank\\\">w0r1d_space@sohu.com</a></p><p>Subject:  北约正经历脑死亡德外长警告法国不要破坏北约</p><p><br></p><p> （原标题：马克龙说北约正经历“脑死亡”，德外长警告法国不要破坏北约） </p><p><br></p><p>【环球网报道 记者 侯佳欣】据路透社报道，德国外长海科·马斯当地时间11月10日警告法国，不要破坏北大西洋公约组织(NATO)。路透社称，这是柏林方面迄今为止对马克龙批评北约相关言论作出的最强烈回应。马克龙日前接受英国《经济学人》杂志采访时称，北约正在经历“脑死亡”。</p><p><img src=\\\"http://cms-bucket.ws.126.net/2019/11/11/c1d93d4ec8cb4feda3af3235f0b7d472.jpeg\\\" alt=\\\"\\\" data-href=\\\"\\\" style=\\\"\\\"/></p><p style=\\\"text-align: center;\\\">(德国外长海科·马斯。图源：路透社)</p><p>针对马克龙的言论，马斯在德国《明镜》周刊发表专栏文章写道：“如果我们削弱了北约，这可能是个错误。没有美国，无论是德国或欧洲都没有办法有效地保护自己。”</p><p><img src=\\\"http://cms-bucket.ws.126.net/2019/11/11/83b5435880684aaeb606a11ffc386e14.png\\\" alt=\\\"\\\" data-href=\\\"\\\" style=\\\"\\\"/></p><p style=\\\"text-align: center;\\\">(路透社报道截图)</p><p>不过，对于马克龙加强欧洲防御能力的呼吁，马斯表示支持。他在文章中写道，“这就是为什么我们要与法国一起努力，建设一个在安全政策上更加紧密合作的欧洲的原因。”</p><p>报道称，马斯再次呼吁建立一个欧洲安全理事会，英国也应该成为其中一员，尽管英国已经计划退出欧盟。马斯称，他正在与法国外长让－伊夫·勒德里昂开展密切合作，德国将在2020年下半年担任欧盟轮值主席国期间提出这个理事会的框架。</p><p>关于马克龙关于北约正在经历“脑死亡”的发言，除德国外长马斯之外，北约秘书长廷斯·斯托尔滕贝格、德国总理默克尔等人也不认同马克龙的观点。</p><p>斯托尔滕贝格称北约依然牢固，“任何疏远欧洲与美国关系的做法不仅有削弱跨大西洋纽带的风险，且可能分裂欧洲”，“欧洲团结不能代替大西洋两岸间的团结”。默克尔同样显现对北约的支持，说这一持续70年的军事联盟“不可或缺”，虽然存在一些问题，但是“符合我们的利益”。</p><p>“北约正在经历‘脑死亡’。”英国《经济学人》杂志7日刊登对法国总统马克龙的专访，他警告欧洲国家，特朗普领导的美国显然“抛弃了我们”，站在“悬崖边上”的欧洲需要思考自己的战略问题，否则将“无法掌控自己的命运”。</p><p><br></p><p> </p><p><br></p><p> 本文来源：环球网 责任编辑：李再兴_NBJS9026<img src=\\\"http://47.244.55.212:8080/435b2d75-3304-4caa-a588-6044dc82e7c9.jpg\\\" alt=\\\"\\\" data-href=\\\"\\\" style=\\\"\\\"/></p>\",\"fromer\":\"w0r1d_space@sohu.com\",\"pullEmailId\":14078,\"receiver\":\"[{\\\"email\\\":\\\"13076506601@163.com\\\",\\\"name\\\":\\\"13076506601@163.com\\\"}]\",\"taskId\":17,\"title\":\"Re: 北约正经历脑死亡德外长警告法国不要破坏北约\"}', '{\"msg\":\"操作成功\",\"code\":200,\"data\":14548}', 0, NULL, '2023-09-20 14:44:11', 39);
